requirement.content:
- участник аукциона должен быть членом саморегулируемой организации (далее - СРО) в области строительства, реконструкции, капитального ремонта объектов капитального строительства, при этом СРО, в которой состоит участник аукциона, должна иметь компенсационный фонд обеспечения договорных обязательств;
- совокупный размер обязательств участника аукциона по договорам, заключаемым с использованием конкурентных способов, не должен превышать уровень ответственности участника по компенсационному фонду обеспечения договорных обязательств;
-уровень ответственности члена саморегулируемой организации по обязательствам по договорам строительного подряда и стоимости работ по одному договору должен соответствовать либо превышать цену контракта, предлагаемую участником закупки, в соответствии с которым указанным членом внесен взнос в компенсационный фонд возмещения вреда;
- участник должен иметь право осуществлять строительство, реконструкцию, капитальный ремонт объектов капитального строительства по договору строительного подряда, заключаемому с использованием конкурентных способов заключения договоров, в отношении объектов капитального строительства (кроме особо опасных, технически сложных и уникальных объектов, объектов использования атомной энергии)

addRequirement.content:
Наличие за последние 5 лет до даты подачи заявки на участие в закупке опыта исполнения (с учетом правопреемства) одного контракта (договора) на выполнение работ по строительству, реконструкции линейного объекта.
            При этом стоимость такого одного исполненного контракта (договора) должна составлять:
            не менее 50 процентов начальной (максимальной) цены контракта (цены лота), на право заключить который проводится закупка, если начальная (максимальная) цена контракта (цена лота) превышает 10 млн. рублей;
            не менее 40 процентов начальной (максимальной) цены контракта (цены лота), на право заключить который проводится закупка, если начальная (максимальная) цена контракта (цена лота) превышает 100 млн. рублей;
            не менее 30 процентов начальной (максимальной) цены контракта (цены лота), на право заключить который проводится закупка, если начальная (максимальная) цена контракта (цена лота) превышает 500 млн. рублей
